import React from 'react';
import selectOptions from '../../../helper/SelectOptions';

const SelectFilter = () => (
  <select
    data-testid="column-filter"
  >
    {selectOptions.map((opt) => (
      <option
        key={ opt }
      >
        {opt}
      </option>
    ))}
  </select>
);

export default SelectFilter;
